import React, { useState } from 'react';
import { NavLink } from 'react-router-dom';
import { motion } from 'framer-motion';
import { 
  FaUsers, 
  FaTrophy, 
  FaCog, 
  FaTelegram, 
  FaHome, 
  FaBars, 
  FaTimes 
} from 'react-icons/fa';

const AdminSidebar = () => {
  const [isMobileMenuOpen, setIsMobileMenuOpen] = useState(false);
  
  const toggleMobileMenu = () => {
    setIsMobileMenuOpen(!isMobileMenuOpen);
  };
  
  const closeMobileMenu = () => {
    setIsMobileMenuOpen(false);
  };
  
  const menuItems = [
    { path: '/admin', icon: <FaHome />, label: 'Главная' },
    { path: '/admin/promoters', icon: <FaUsers />, label: 'Промоутеры' },
    { path: '/admin/top-promoter', icon: <FaTrophy />, label: 'Лучший промоутер' },
    { path: '/admin/telegram', icon: <FaTelegram />, label: 'Telegram' },
    { path: '/admin/settings', icon: <FaCog />, label: 'Настройки' },
  ];
  
  return (
    <>
      {/* Мобильная кнопка меню */}
      <div className="md:hidden fixed top-4 right-4 z-50">
        <button
          onClick={toggleMobileMenu}
          className="bg-dark p-2 rounded-md text-white focus:outline-none"
        >
          {isMobileMenuOpen ? <FaTimes size={24} /> : <FaBars size={24} />}
        </button>
      </div>
      
      {/* Боковая панель - десктоп */}
      <div className="hidden md:block w-64 bg-dark h-full shadow-lg">
        <div className="p-6">
          <h2 className="text-xl font-bold text-white mb-6">
            <span className="text-primary">Админ</span>
            <span className="text-secondary">Панель</span>
          </h2>
          
          <nav>
            <ul className="space-y-2">
              {menuItems.map((item) => (
                <li key={item.path}>
                  <NavLink
                    to={item.path}
                    end={item.path === '/admin'}
                    className={({ isActive }) => 
                      `flex items-center px-4 py-3 rounded-md transition-colors ${
                        isActive 
                          ? 'bg-primary text-white' 
                          : 'text-gray-400 hover:bg-dark-lighter hover:text-white'
                      }`
                    }
                  >
                    <span className="mr-3">{item.icon}</span>
                    <span>{item.label}</span>
                  </NavLink>
                </li>
              ))}
            </ul>
          </nav>
        </div>
      </div>
      
      {/* Мобильное меню */}
      {isMobileMenuOpen && (
        <motion.div
          initial={{ opacity: 0, x: -100 }}
          animate={{ opacity: 1, x: 0 }}
          exit={{ opacity: 0, x: -100 }}
          transition={{ duration: 0.3 }}
          className="fixed inset-0 z-40 md:hidden"
        >
          <div className="absolute inset-0 bg-black bg-opacity-50" onClick={closeMobileMenu}></div>
          
          <div className="absolute inset-y-0 left-0 w-64 bg-dark shadow-lg">
            <div className="p-6">
              <h2 className="text-xl font-bold text-white mb-6">
                <span className="text-primary">Админ</span>
                <span className="text-secondary">Панель</span>
              </h2>
              
              <nav>
                <ul className="space-y-2">
                  {menuItems.map((item) => (
                    <li key={item.path}>
                      <NavLink
                        to={item.path}
                        end={item.path === '/admin'}
                        className={({ isActive }) => 
                          `flex items-center px-4 py-3 rounded-md transition-colors ${
                            isActive 
                              ? 'bg-primary text-white' 
                              : 'text-gray-400 hover:bg-dark-lighter hover:text-white'
                          }`
                        }
                        onClick={closeMobileMenu}
                      >
                        <span className="mr-3">{item.icon}</span>
                        <span>{item.label}</span>
                      </NavLink>
                    </li>
                  ))}
                </ul>
              </nav>
            </div>
          </div>
        </motion.div>
      )}
    </>
  );
};

export default AdminSidebar;
